        <Header />
        <Navibar />
        <Person name={this.state.persons[0].name} mobile={this.state.persons[0].mobile}/>
        <Person name={this.state.persons[1].naem} mobile={this.state.persons[1].mobile}>Second Person</Person>

      </div>
    );
  }

}
export default App;



